export default function ChatPage() {
    const location = useLocation();
    console.log('ChatPage:::', location.state);
    return (
        <div className="chatPage">
            <ChatFrame roomName={location.state.roomName} nickName={location.state.nickName} />
            <LogFrame />
        </div>
    );
}
